import Typewriter from 'typewriter-effect';

export default function Landing() {
    return (
        <div className="auth-parent">
            <div className="panel">
                <div className="paneltext">
                <Typewriter 
                      options={{
                        autoStart: true,
                        deleteSpeed: 50,
                        delay: 50,
                        strings: [
                          "hi\n hello"
                        ]
                      }}
                    />
                </div>
            </div>
        </div>
    )
}
